function Page() {
  const { step, setStep } = useContext(globalContext);

  return (
    <>
      <NextPrevNav
        nextLink="/dashboard/services/content-press-release/release-content"
        nextOnClick={() => setStep(step + 1)}
      >
        <div className="flex flex-col gap-[var(--64px)] justify-center items-center h-full">
          <div
            className={classNames(
              "flex flex-col items-center gap-[var(--16px)] text-center",
              styles.container
            )}
          >
            <h2 className="text-[--30px] font-bold w-[73%] mx-auto">
            Could you please specify the niche or focus area of your press releases?
            </h2>
            <p className="text-[--18px] text-[#FFFFFFCC]">
            Please select the option that best describes your project type. 
            <br />
            This helps us understand the specific requirements for your project.
            </p>
          </div>
          <div className={classNames("flex ", styles.cards)}>
            <div
              className={classNames(
                "flex flex-col gap-[var(--8px)] group",
                styles.card
              )}
            >
              <div className="flex items-center justify-center relative">
                <img
                  src="/assets/application-design-service-gamecard.gif"
                  alt="/assets/application-design-service-gamecard.gif"
                  className="w-full"
                />
                {gameSVG}
              </div>
              <div>Game</div>
              <input
                type="radio"
                name="type"
                value="game"
                className="absolute opacity-0 inset-0 cursor-pointer"
              />
            </div>
            <div
              className={classNames(
                "flex flex-col gap-[var(--sy-8px)]",
                styles.card
              )}
            >
              <div className="flex items-center justify-center relative">
                <img
                  src="/assets/application-design-service-applicationcard.gif"
                  alt="/assets/application-design-service-applicationcard.gif"
                  className="w-full"
                />
                {appSVG}
              </div>
              <div>Application</div>
              <input
                type="radio"
                name="type"
                value="app"
                className="absolute opacity-0 inset-0 cursor-pointer"
              />
            </div>
            <div
              className={classNames(
                "flex flex-col gap-[var(--8px)] group",
                styles.card
              )}
            >
              <div className="flex items-center justify-center relative">
                <img
                  src="/assets/application-design-service-gamecard.gif"
                  alt="/assets/application-design-service-gamecard.gif"
                  className="w-full"
                />
                {gameSVG}
              </div>
              <div>Game</div>
              <input
                type="radio"
                name="type"
                value="game"
                className="absolute opacity-0 inset-0 cursor-pointer"
              />
            </div>
            <div
              className={classNames(
                "flex flex-col gap-[var(--sy-8px)]",
                styles.card
              )}
            >
              <div className="flex items-center justify-center relative">
                <img
                  src="/assets/application-design-service-applicationcard.gif"
                  alt="/assets/application-design-service-applicationcard.gif"
                  className="w-full"
                />
                {appSVG}
              </div>
              <div>Application</div>
              <input
                type="radio"
                name="type"
                value="app"
                className="absolute opacity-0 inset-0 cursor-pointer"
              />
            </div>
          </div>
        </div>
      </NextPrevNav>
    </>
  );
}

export default Page;
